import React from "react";

const OrderContent = ({ orderObject }) => {
  return (
    <React.Fragment>
      <div className="accordion-content">
        {orderObject.description}
        {orderObject.quantity}
      </div>
    </React.Fragment>
  );
};

export default OrderContent;
